Changes:

- remove report from task engine;
- remove old logic for hangs and 'idling' statuses;
- increase code redability;
- add code docs;
- support retries in case of MClient errors for status
  and run actions

Todo:

- puppet run call take too much time. It behavior in case of
  problem block event loop and can take 120 sec
  (see puppet_fade_timeout in config)
- mcollective can retry calls 5 times which also block event loop

Change-Id: I98fe3df65ef335b03eceb2c401eba12cf68ee1c8
